import ExpenseItem from "./ExpenseItem";
function NewExpense(props) {
  return (
    <div>
     <ExpenseItem
        name={props.date[0].title}
        date={props.date[0].date}
        amount={props.date[0].amount}
      ></ExpenseItem>
      <ExpenseItem
        name={props.date[1].title}
        date={props.date[1].date}
        amount={props.date[1].amount}
      ></ExpenseItem>
      <ExpenseItem
        name={props.date[2].title}
        date={props.date[2].date}
        amount={props.date[2].amount}
      ></ExpenseItem>
      <ExpenseItem
        name={props.date[3].title}
        date={props.date[3].date}
        amount={props.date[3].amount}
      ></ExpenseItem>
    </div>
  );
}
export default NewExpense;
